(function(g,$,bootbox){g.ComposerConsole=function(inputUrl){this.url=inputUrl;this.init()};g.ComposerConsole.prototype={init:function(){var composerConsole=this;$.ajax({url:composerConsole.url,type:"GET",success:function(response){composerConsole.content=response.content},error:composerConsole.error})},refresh:function(){this.init()},view:function(){var consoleView=$("#console-content").html('<i class="material-icons loader">rotate_right</i>').toggleClass("hidden-xs-up hidden-xs-down");$("#open-console").toggleClass("active");$(window).scrollTop($("body").height());do{}while(this.content===undefined);if(this.content=="")this.content="Console output is empty.";consoleView.html("<pre><code>"+this.content+"</code></pre>")},error:function(xhr){bootbox.alert("Something went wrong please refer to the developer console for more info.");console.log(xhr.responseText)}}})(window,jQuery,bootbox);